import styled from "styled-components";

export const Container = styled.div`
margin: 0px;
padding: 0px;
`

export const ContainerMoviePrincipal = styled.div`
height: 100vh;
`

export const ContainerTitle = styled.div`
margin: 0px;
padding: 0px;
width: 800px;
position: absolute;
top: 300px;
left: 45px;

h1 {
    font-size: 50px;
}
`
